import React, { Component } from 'react';
import ScrollAnimation from 'react-animate-on-scroll';

export default class Works extends Component {
    render() {
        return (
            <article className="Works" id="myWorks">
                <ScrollAnimation animateIn="fadein">
                <a className="caseOne" href="https://chrisdemey.github.io/restaurant-css-framework/" target="_blank"></a>
                </ScrollAnimation>
                <a className="caseTwo" href="https://chrisdemey.github.io/TD2-cssgrid/" target="_blank"></a>
                <a className="caseThree" href="https://cleobuck.github.io/allezcinev3/" target="_blank"></a>
                <a className="caseFour" href="https://chrisdemey.github.io/Hitman-site/" target="_blank"></a>
                <ScrollAnimation animateIn="fadeIn">
                    <p>Cette section sera régulièrement mise à jour</p>
                </ScrollAnimation>
            </article>
        );
    }
}
